export default function GetPointLeaders(data) {

    const GetLeaderStats = () => {
        const leader = {
            'name': 'Test',
            'img': 'Image',
            'pts': 'Pts',
            'ast': 'Ast',
            'min': 'Min'
        }
        return leader;
    }

    const GetSecondStats = () => {
        const second = {
            'name': 'Test',
            'img': 'Image',
            'pts': 'Pts',
            'ast': 'Ast',
            'min': 'Min'
        }
        return second;
    }

    const GetThirdStats = () => {
        const third = {
            'name': 'Test',
            'img': 'Image',
            'pts': 'Pts',
            'ast': 'Ast',
            'min': 'Min'
        }
        return third;
    }

    const ScoreData = {
        'first': { GetLeaderStats },
        'second': { GetSecondStats },
        'third': { GetThirdStats }
    }

    return ScoreData;

}
